const moveDir = (moves) => {
    switch(curDir){
        case 0:
            moveRight(moves);
            break;
        case 1:
            moveDown(moves);
            break;
        case 2:
            moveLeft(moves);
            break;
        case 3:
            moveUp(moves);
            break;
    };
};

const getSolution = () => {
    let rowModifier = 0;
    let colModifier = 0;
    if (curQuadrant === 0 || curQuadrant === 2 || curQuadrant === 4) colModifier = 50;
    if (curQuadrant === 1) colModifier = 100;
    if (curQuadrant === 2) rowModifier = 50;
    if (curQuadrant === 3 || curQuadrant === 4) rowModifier = 100;
    if (curQuadrant === 5) rowModifier = 150;

    return (1000*(curRow + rowModifier + 1)) + (4 * (curCol + colModifier + 1)) + curDir;
};

const traverse = () => {
    for (const inst of instructions){
        if (typeof inst === 'string') {
            changeDir(inst);
            continue;
        }
        moveDir(inst);
    }
};

